import React from 'react';
import { Box, useColorModeValue, Center, Text } from '@chakra-ui/react';
import {
  FaFacebookF,
  FaLinkedinIn,
  FaGithub,
  FaMailBulk,
} from 'react-icons/fa';

import Header from '../Components/Header';
import ButtonGroup from '../Components/ButtonGroup';

const Contact = () => {
  const bg = useColorModeValue('blue', 'yellow');
  return (
    <Box minH="40vh">
      <Header title="Contact" description="Say Hi" />
      <Text px={20} fontSize="xl" pt={2}>
        Reach out to me on social media if you want to work on something
        together ðŸ˜€
      </Text>
      <Box display="flex" justifyContent="center">
        <ButtonGroup bg={bg} name={<FaFacebookF />} />
        <ButtonGroup bg={bg} name={<FaLinkedinIn />} />
        <ButtonGroup bg={bg} name={<FaGithub />} />
        <ButtonGroup bg={bg} name={<FaMailBulk />} />
      </Box>
    </Box>
  );
};

export default Contact;
